    public function import_talent_insight()
    {
        $html = file_get_contents('./uploads/imports_admin/TALENT insight.html');

        $dom = new DOMDocument();
        libxml_use_internal_errors(true);
        $dom->loadHTML($html);

        $rows = $dom->getElementsByTagName('tr');
        $insights = []; // array penampung

        foreach ($rows as $row) {

            $cols = $row->getElementsByTagName('td');

            // kalau tidak ada <td>, skip
            if ($cols->length == 0) continue;

            $rowData = [];

            // ambil semua kolom dalam <td>
            foreach ($cols as $col) {

                // ambil seluruh HTML di dalam <td> (span, br, dll)
                $innerHTML = '';
                foreach ($col->childNodes as $child) {
                    $innerHTML .= $col->ownerDocument->saveHTML($child);
                }

                // simpan ke array (versi HTML)
                $rowData[] = trim($innerHTML);
            }

            // masukkan 1 baris penuh
            $insights[] = $rowData;
        }
        $insights = array_filter($insights, fn($ins_i, $i_ins) => $i_ins > 1 && $ins_i[0] && $ins_i[8] && ($ins_i[11] || $ins_i[12] || $ins_i[13]), ARRAY_FILTER_USE_BOTH);
        $insights = array_values($insights);
        $not_found = [];
        $found = [];
        foreach ($insights as $i_ins => $ins_i) {
            $comp_lvl_assess = $this->db->get_where('comp_lvl_assess', array('NRP' => $ins_i[0], 'method_id' => $ins_i[10], 'tahun' => $ins_i[8]))->row_array();
            if (!$comp_lvl_assess) {
                $not_found[] = $ins_i;
            } else {
                $data = [
                    'assessment_insight_strength' => $ins_i[11] && $ins_i[11] != '' ? $ins_i[11] : null,
                    'assessment_insight_development' => $ins_i[12] && $ins_i[12] != '' ? $ins_i[12] : null,
                    'talent_insight' => $ins_i[13] && $ins_i[13] != '' ? $ins_i[13] : null,
                ];
                $success = $this->db->where('id', $comp_lvl_assess['id'])->update('comp_lvl_assess', $data);
                $found[] = $ins_i;
            }
        }
        echo '<pre>', print_r(count($found), true);
        die;
    }

