        $labels = array_reverse($rawLabels);
        $employees = $off_pr;

        if (empty($employees)) return [];

        // Filter data valid
        $filtered = array_filter($employees, function ($e) {
            return isset($e['val3'], $e['val2'])
                && is_numeric($e['val3'])
                && is_numeric($e['val2']);
        });

        if (empty($filtered)) {
            // tidak ada data valid
            foreach ($employees as &$emp) {
                $emp['status'] = null;
            }
            return $employees;
        }
        $potentials   = array_column($filtered, 'val3');
        $performances = array_column($filtered, 'val2');

        function floor1($value)
        {
            return floor($value * 10) / 10;
        }

        function ceil1($value)
        {
            return ceil($value * 10) / 10;
        }

        // PAKAI MARGIN
        $xMin = floor1(min($potentials)   - 0.1);
        $xMax = ceil1(max($potentials)    + 0.1);
        $yMin = floor1(min($performances) - 0.1);
        $yMax = ceil1(max($performances)  + 0.1);


        echo '<pre>', print_r($xMin, true);
        echo '<pre>', print_r($xMax, true);
        echo '<pre>', print_r($yMin, true);
        echo '<pre>', print_r($yMax, true);

        $xStep = ($xMax - $xMin) / 4;
        $yStep = ($yMax - $yMin) / 4;

        // pre-calc buat sedikit micro-optim
        $invXStep = 1 / $xStep;
        $invYStep = 1 / $yStep;

        foreach ($employees as &$emp) {
            if (
                !isset($emp['val3'], $emp['val2']) ||
                !is_numeric($emp['val3']) ||
                !is_numeric($emp['val2'])
            ) {

                $emp['status'] = null; // atau '(Unknown)'
                continue;
            }

            $x = (float)$emp['val3'];
            $y = (float)$emp['val2'];

            // hitung index kolom (03) dan baris (03) langsung
            $col = (int)floor(($x - $xMin) * $invXStep);
            $row = (int)floor(($y - $yMin) * $invYStep);

            // clamp supaya tetap 03
            if ($col < 0 || $col > 3 || $row < 0 || $row > 3) {
                $emp['status'] = '(Unknown)';
            } else {
                $emp['status'] = $labels[$row][$col];
            }
        }

        echo '<pre>', print_r($employees, true);

        foreach ($employees as $i_emp => $emp_i) {
            if (!$emp_i['status']) continue;
            $exists = $this->db->get_where('emp_hav_rcrd', array('NRP' => $emp_i['val0'], 'year' => $emp['val4'], 'method_id' => $emp['val1']))->row_array();
