        function parseDateToYmd($date)
        {
            if ($date === null || $date === '') return false;

            // CASE 1: Excel Serial Number (full numeric)
            if (is_numeric($date) && preg_match('/^\d+$/', (string)$date)) {
                $serial = (int)$date;

                if ($serial > 20000 && $serial < 60000) {
                    $origin = new DateTime('1899-12-30');
                    $origin->modify("+$serial days");
                    return $origin->format('Y-m-d');
                }
            }

            // Convert to string
            $date = trim((string)$date);

            // Normalize multiple spaces
            $date = preg_replace('/\s+/', ' ', $date);

            // Mapping bulan Indonesia  Inggris
            $indoMonths = [
                'Januari'   => 'January',
                'Februari'  => 'February',
                'Maret'     => 'March',
                'April'     => 'April',
                'Mei'       => 'May',
                'Juni'      => 'June',
                'Juli'      => 'July',
                'Agustus'   => 'August',
                'September' => 'September',
                'Oktober'   => 'October',
                'November'  => 'November',
                'Desember'  => 'December',
            ];

            $dateEn = str_ireplace(array_keys($indoMonths), array_values($indoMonths), $date);

            // ALL supported formats
            $formats = [
                'Y-m-d',
                'd-m-Y',
                'j-m-Y',
                'd/m/Y',
                'j/m/Y',
                'd F Y',
                'j F Y'
            ];

            foreach ($formats as $format) {
                $d = DateTime::createFromFormat($format, $dateEn);
                if ($d && $d->format($format) === $dateEn) {
                    return $d->format('Y-m-d');
                }
            }

            return false;
        }

        $tod = array_map(function ($row) {
            $parsed = parseDateToYmd($row['val4']);
            if ($parsed !== false) {
                $row['val4'] = $parsed;
            } else {
                $row['val4'] = null; // atau tetap biarkan false sesuai kebutuhan
            }
            return $row;
        }, $tod);

        function isValidDate($date, $format = 'Y-m-d')
        {
            $d = DateTime::createFromFormat($format, $date);
            return $d && $d->format($format) === $date;
        }

        $tod = array_filter(
            $tod,
            function ($row) {
                if ($row['val2'] == '#N/A' || !$row['val2']) {
                    $row['val4'] = null;
                }
                $valid_status = in_array($row['val3'], [
                    'Done',
                    'Approval Complete',
                    'Done (CANCEL, Ganti ke SK Acting)'
                ]);

                $parsed_date = parseDateToYmd($row['val4']);

                if ($parsed_date !== false) {
                    $row['val4'] = $parsed_date;
                } else {
                    return false; // tanggal invalid  buang
                }

                return $valid_status;
            }
        );

        foreach ($tod as $i_tod => $tod_i) {
            if (strlen($tod_i['val0']) === 7) {
                $tod_i['val0'] = '1' . $tod_i['val0'];
            }
            $data = [
                'NRP' => $tod_i['val0'],
                'position' => $tod_i['val1'],
                'date' => $tod_i['val4'],
            ];
            // $this->db->insert('emp_tour_of_duty', $data);
            // $insert_id = $this->db->insert_id();

            $mp_ids = preg_split('/[.,]+/', $tod_i['val2']);
            foreach ($mp_ids as $i_mp_id => $mp_id_i) {
                $data = [
                    // 'emp_tour_of_duty_id' => $insert_id,
                    'matrix_point_id' => $mp_id_i,
                ];
                // $this->db->insert('emp_tour_of_duty_mp', $data);
            }
        }
        die;
    }

