        function explode_nrp($nrps)
        {
            $lines = preg_split('/\r\n|\r|\n/', trim($nrps));

            $result = [];

            foreach ($lines as $line) {
                if (preg_match('/\d{8}/', $line, $match)) {
                    $result[] = $match[0];
                }
            }
            return $result;
        }

        $years = [null, 2026, 2027, 2028];

        foreach ($rtcs as $i_rtc => $rtc_i) {
            if (!$rtc_i['val0']) continue;
            for ($i = 1; $i <= 3; $i++) {
                $nrp = explode_nrp($rtc_i["val$i"]);
                foreach ($nrp as $i_nrp => $nrp_i) {
                    $data = [
                        'oalp_id' => $rtc_i['val0'],
                        'NRP' => $nrp_i,
                        'year' => $years[$i],
                        'order' => $i_nrp,
                    ];
                    // $this->db->insert('rtc', $data);
                }
            }
        }
